export const addShow = (showName, venue) => {
    let showObject= {
        showName,
        venue
    };
    return {
        type: 'ADD_SHOW',
        payload: showObject
    }
}

export const getShows = () => {
    return {
        type: 'GET_SHOWS'
    }
}
